INSERT INTO `danhgiaphim` VALUES (1,1,'Thanh Gươm Diệt Quỷ / Demon Slayer / Kimetsu No Yaiba là một thương hiệu sở hữu nhiều thành tích vô tiền khoáng hậu trong lịch sử ngành anime và manga Nhật Bản. Khởi đầu tốt nhưng không quá xuất sắc, phiên bản hoạt hình trung thành nguyên tác đã giúp truyện tranh phá vỡ hàng loạt cột mốc xuất bản. Thậm chí, phim điện ảnh hoạt hình Demon Slayer: Kimetsu no Yaiba – The Movie: Mugen Train còn đang nắm giữ kỉ lục ăn khách nhất lịch sử phim chiếu rạp tại xứ sở mặt trời mọc với doanh thu 507 triệu $. Nhân vật chính Kamado Tanjiro vốn là một cậu bé nông thôn bình thường, chăm chỉ làm việc và giúp mẹ chăm sóc đàn em. Ngày nọ, biến cố ập tới, gia đình Tanjiro bị sát hại gần hết. Em gái Nezuko hóa quỷ. Căm hận chúa quỷ Muzan và mong muốn cứu chữa cho em, Tanjiro cố công rèn luyện thành kiếm sĩ  diệt quỷ, chiến đấu chống lại kẻ thù mạnh hơn mình gấp hàng trăm ngàn lần. Cõng Nezuko trong chiếc hộp gỗ, trên hành trình nhọc nhằn, cậu kết bạn với cậu bé nhát gan Zenitsu và đầu heo nóng nảy Inosuke. Ở tập phim điện ảnh trước – Mugen Train, Tanjiro và bạn bè đã lên Chuyến Tàu Vô Tận cùng Viêm Trụ Rengoku Kyoujuro. Cả bọn thành công tiêu diệt Hạ Huyền Nhất Enmu. Tuy nhiên, Thượng Huyền Tam Akaza đột ngột xuất hiện, Kyoujuro hi sinh. Sau khi dưỡng thương; Tanjiro, Zenitsu và Inosuke bị Âm Trụ Uzui Tengen đưa tới Phố đèn đỏ để giả làm kỹ nữ, điều tra về một con quỷ đang lẩn trốn nơi đây. Họ thành công tìm bắt ả Daki xảo trá nhưng lại rơi vào tình thế vô cùng khó khắn. Hóa ra Daki và người anh Gyutaro là quỷ Thượng Huyền hùng mạnh! Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-demon-slayer-to-the-swordsmith-village-phim-tri-an-man-nhanXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-demon-slayer-to-the-swordsmith-village-phim-tri-an-man-nhan','review vui về phim, just for fun ^^',NULL),(1,2,'Thanh Gươm Diệt Quỷ / Demon Slayer / Kimetsu No Yaiba là một thương hiệu sở hữu nhiều thành tích vô tiền khoáng hậu trong lịch sử ngành anime và manga Nhật Bản. Khởi đầu tốt nhưng không quá xuất sắc, phiên bản hoạt hình trung thành nguyên tác đã giúp truyện tranh phá vỡ hàng loạt cột mốc xuất bản. Thậm chí, phim điện ảnh hoạt hình Demon Slayer: Kimetsu no Yaiba – The Movie: Mugen Train còn đang nắm giữ kỉ lục ăn khách nhất lịch sử phim chiếu rạp tại xứ sở mặt trời mọc với doanh thu 507 triệu $. Nhân vật chính Kamado Tanjiro vốn là một cậu bé nông thôn bình thường, chăm chỉ làm việc và giúp mẹ chăm sóc đàn em. Ngày nọ, biến cố ập tới, gia đình Tanjiro bị sát hại gần hết. Em gái Nezuko hóa quỷ. Căm hận chúa quỷ Muzan và mong muốn cứu chữa cho em, Tanjiro cố công rèn luyện thành kiếm sĩ  diệt quỷ, chiến đấu chống lại kẻ thù mạnh hơn mình gấp hàng trăm ngàn lần. Cõng Nezuko trong chiếc hộp gỗ, trên hành trình nhọc nhằn, cậu kết bạn với cậu bé nhát gan Zenitsu và đầu heo nóng nảy Inosuke. Ở tập phim điện ảnh trước – Mugen Train, Tanjiro và bạn bè đã lên Chuyến Tàu Vô Tận cùng Viêm Trụ Rengoku Kyoujuro. Cả bọn thành công tiêu diệt Hạ Huyền Nhất Enmu. Tuy nhiên, Thượng Huyền Tam Akaza đột ngột xuất hiện, Kyoujuro hi sinh. Sau khi dưỡng thương; Tanjiro, Zenitsu và Inosuke bị Âm Trụ Uzui Tengen đưa tới Phố đèn đỏ để giả làm kỹ nữ, điều tra về một con quỷ đang lẩn trốn nơi đây. Họ thành công tìm bắt ả Daki xảo trá nhưng lại rơi vào tình thế vô cùng khó khắn. Hóa ra Daki và người anh Gyutaro là quỷ Thượng Huyền hùng mạnh! Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-demon-slayer-to-the-swordsmith-village-phim-tri-an-man-nhan\n\nXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-demon-slayer-to-the-swordsmith-village-phim-tri-an-man-nhan','review vui về phim, just for fun ^^',NULL),(2,1,'Nếu nghĩ Nhện nhí nhà Marvel hay gã phản anh hùng Deadpool là những tên siêu năng lực nói nhiều nhất vũ trụ phim siêu anh hùng thì bạn nhầm to rồi. Chàng Shazam có khi ồn ào bằng cả đôi Spiderpool cộng lại! Là cậu nhóc ăn chưa no và lo chưa tới, thậm chí còn chẳng biết mình sẽ học gì làm gì ở mốc 18 tuổi, Billy Baston trở thành chiến thần bảo vệ nhân loại. Ở đoạn kết phần trước, sau khi đánh bại gã tiến sĩ Sivana, cậu nhóc và các anh chị em nuôi đều sở hữu sức mạnh siêu phàm. Khổ nỗi, dù là siêu anh hùng nhưng thực chất đây vẫn là đám choai choai mười mấy tuổi. Hậu quả là, thay vì được vinh danh như Liên Minh Công Lý hay Hội Công lý, gia đình nhỏ bị gán cho danh hiệu Báo thủ Philadelphia! Chưa hết, trong khi “bầy báo” đang vật lộn cùng sự ngốc nghếch và tâm tình tuổi mới lớn, những cô con gái nhà Atlas tới tìm họ để đòi sức mạnh. À, nào phải đòi, họ tước đoạt! Vẫn do đạo diễn phần trước David F. Sanberg cầm trịch, phim mới Shazam! Fury Of The Gods tiếp tục sử dụng màu phim tươi sáng và theo phong cách vui nhộn, đặc biệt hẳn so với các tác phẩm khác thuộc vũ trụ điện ảnh DC mở rộng. Hàng loạt miếng hài cười lăn cười bò rải xuyên suốt phim, đến tận phút cuối của after credit.  Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-shazam-fury-of-the-gods-lon-xon-nhung-rat-nhon\n\nXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-shazam-fury-of-the-gods-lon-xon-nhung-rat-nhon','review vui về phim, just for fun ^^',NULL),(2,2,'Vẫn do đạo diễn phần trước David F. Sanberg cầm trịch, phim mới Shazam! Fury Of The Gods tiếp tục sử dụng màu phim tươi sáng và theo phong cách vui nhộn, đặc biệt hẳn so với các tác phẩm khác thuộc vũ trụ điện ảnh DC mở rộng. Hàng loạt miếng hài cười lăn cười bò rải xuyên suốt phim, đến tận phút cuối của after credit.  Kịch bản Shazam! Fury Of The Gods đơn giản, dễ đoán và gần như không có pha bẻ lái ngoạn mục nào. Tuy vậy, đây lại là điểm cộng cho phim. Nhân vật chính chỉ là cậu thiếu niên bốc đồng, ngây thơ, chưa trải sự đời. Thực tế, với một kịch bản hổng-cần-não, Shazam! và Black Adam chiếm được cảm tình của kha khá khán giả. Doanh thu lần lượt là 366 triệu $ và 393 triệu $   Shazam! Fury Of The Gods thể hiện rõ ràng việc đề cao “gia đình”. Thậm chí, Shazam! còn nhắc tới bộ phim hành động Fast & Furious với câu thoại “Quan trọng là gia đình”. Đây vừa là trứng phục sinh vì người thủ vai Hespera - nữ diễn viên kì cựu Helen Mirren cũng tham gia Quá Nhanh Quá Nguy Hiểm. Kĩ xảo cộng điểm rất lớn cho Shazam! 2. Con rồng Ladon gây ấn tượng mạnh mẽ. Trường đoạn quái vật xuất hiện và quậy tưng bừng thành phố đủ sức làm khán giả ám ảnh. Thật đáng ngạc nhiên khi kinh phí vỏn vẹn 125 triệu $. Có lẽ thời gian hậu kì đủ lâu đã giúp Fury Of The Gods “khéo co thì ấm”. Người anh em Marvel nên học hỏi và để đội ngũ sản xuất VFX nhà mình thêm thời gian hoàn thiện. So với phần trước, Shazam! Sự Phẫn Nộ Của Các Vị Thần ít cảnh xáp lá cà bởi con gái Atlas chủ yếu xài phép thuật. Dẫu vậy, trận chiến giữa các chiến thần Shazam! và hội nữ thần vài ngàn tuổi cũng vô cùng hài hước. Nhất là đoạn đánh hội đồng Hespera. Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-shazam-fury-of-the-gods-lon-xon-nhung-rat-nhon\n\nXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-shazam-fury-of-the-gods-lon-xon-nhung-rat-nhon','review vui về phim, just for fun ^^',NULL),(3,1,'Câu chuyện về gia đình người phụ nữ châu Á Evelyn Wang làm chấn động cả thế giới. Đưa khán giả trải nghiệm hàng loạt cung bậc cảm xúc khác nhau, đi từ bất ngờ này đến bất ngờ khác, mở ra đa vũ trụ hỗn loạn hơn cả “multiverse of madness” của Doctor Strange. Evelyn Wang (Dương Tử Quỳnh) là người phụ nữ trung niên gốc Trung sống tại Mỹ nhiều năm. Bà sở hữu cửa tiệm giặt ủi đang dần xuống cấp. Cơm áo gạo tiền dần khiến Evelyn ngày càng cáu bẳn. Ông chồng Waymond (Quan Kế Huy) nhu nhược, người cha (James Hong) dần lú lẫn, con gái Joy (Stephanie Hsu) chẳng sống chung. Năm mới đến gần, Evelyn nào có tâm trạng vui vẻ đón lễ, bà phải đau đầu tính toán các khoản thuế để “đấu trí” cùng nhân viên cục Deirdre (Jamie Lee Curtis). Một biến cố khiến mọi nhận thức về thế giới này của Evelyn thay đổi. Hóa ra có hàng triệu triệu Evelyn khác nhau đã đang và sẽ tồn tại. Bà chỉ là con kiến nhỏ giữa muôn vàn vũ trụ. Tất cả mọi thứ tưởng là quan trọng đều chẳng ý nghĩa gì! Bộ đôi Daniel Scheinert và Daniel Kwan thành công nên tác phẩm đa tầng, đa nghĩa nhưng lại diễn giải vô cùng dễ hiểu. Kịch bản chặt chẽ, logic và liên kết từng cảnh quay. Họ chứng tỏ bản thân đúng là cặp bài trùng xuất sắc khi cùng viết kịch bản và chỉ đạo Everything Everywhere All At Once! Nhịp nhàng, ăn khớp và hoàn hảo! Scheinert và Kwan gặp nhau khi học làm phim tại Cao đẳng Emerson. Từ năm 2011, cả hai cùng nhau đạo diễn nhiều MV ca nhạc trong đó có Turn Down For What nổi tiếng. Năm 2016, họ lấn sân sang mảng điện ảnh, cùng biên kịch và đạo diễn Swiss Army Man. Tuy tác phẩm hài kì ảo với sự tham gia của Daniel Radcliffe và Paul Dano không đạt doanh thu khả quan nhưng giúp Scheinert và Kwan giành giải đạo diễn tại liên hoan phim Sundance 2016. Đây là bệ phóng quan trọng giúp họ đạt Everything Everywhere All At Once chẳng phải tác phẩm kinh phí lớn. Thậm chí, đội ngũ VFX cả bộ phim chỉ vỏn vẹn chín người, bao gồm luôn cặp đôi đồng biên kịch – đạo diễn. Chỉ học miễn phí từ các lớp online, nhóm đã tạo nên siêu phẩm giành Oscar. Thật khó tin nhưng có thật! Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-everything-everywhere-all-at-once-phim-oscar-khong-he-kho-hieu\n\nXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-everything-everywhere-all-at-once-phim-oscar-khong-he-kho-hieu','review vui về phim, just for fun ^^',NULL),(3,2,'Những gì mà Siêu Lừa Gặp Siêu Lầy đem tới không đơn thuần là những tràng cười sảng khoái, mà còn có sự cao thấp hơn thua khi các bộ não hoạt động tối đa công suất. Đi cùng đấy vẫn có khoảnh khắc lắng đọng về thân phận, cuộc đời và nỗi niềm của từng người. Dẫn đến thông điệp cuối cùng là tình đồng đội, tình bạn bè, sẵn sàng xả thân bên nhau lúc hoạn nạn và cùng chia niềm vui hạnh phúc nhất. Sau khi “lỡ hẹn” với khán giả vào dịp Tết Nguyên Đán, giờ đây phim mới nhất của đạo diễn Võ Thanh Hòa tiếp tục chứng minh tài năng của nhà làm phim dày dặn kinh nghiệm này với thể loại sở trường: hành động pha hài hước. Phim kể về sự đụng độ bất đắc dĩ giữa Tú (Anh Tú) và Khoa (Mạc Văn Khoa), hai người đều kiếm sống bằng nghề lừa gạt. Sau khi chứng kiến “đẳng cấp” của Tú và đồng bọn thì Khoa tìm cách để xin nhập hội. Từ đây nhóm siêu lừa với mỗi thành viên đều có biệt tài riêng bắt đầu con đường chinh chiến. Ngoại trừ Tú và Khoa làm lãnh đạo thì còn có bé Mã Lai (Ngọc Phước) – một chuyên gia công nghệ đầy bản lĩnh. Còn lại là chú Năm (Trung Lùn) – “người vận chuyển” với biệt tài lái xe siêu hạng. Sau nhiều lần “phạm tội” thành công, cả nhóm tiếp cận một “người bị hại” trông có vẻ đầy tiềm năng, mục đích là gom trọn vố lớn để sống thoải mái về sau. Tuy nhiên có thật sự lúc nào cũng dễ dàng đạt thành công như vậy? Nổi bật nhất khi xem Siêu Lừa Gặp Siêu Lầy chắc chắn là những tình tiết gây cười duyên dáng đầy thông minh. Nếu Mạc Văn Khoa chỉ cần đứng im cũng đủ làm người xem khó lòng”nhăn mặt”, thì đến Ngọc Phước và Trung Lùn chính thức khiến cả rạp chiếu phim náo loạn bởi những chiêu trò quá trời quá đất. Xem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-sieu-lua-gap-sieu-lay-phi-vu-hoan-hao-cua-dien-anh-viet\nXem thêm tại: https://www.galaxycine.vn/binh-luan-phim/review-sieu-lua-gap-sieu-lay-phi-vu-hoan-hao-cua-dien-anh-viet','review vui về phim, just for fun ^^',NULL);
