INSERT INTO `phim` VALUES (1,'../assets/anhphim1.jpg','Dave Wilson','Chuột hum tor',1,'11/3/2023','  Ray Garrison là một sĩ quan cấp cao đã hy sinh trong một trận chiến. Thế nhưng, anh được tái sinh bằng công nghệ cao, giúp Ray sở hữu sức mạnh siêu nhiên và khả năng phục hồi nhanh chóng. Vận dụng những kỹ năng mới, anh săn lùng gã đàn ông đã giết vợ mình. Thế nhưng, khi sự thật dần hé mở, Ray nhận ra rằng không phải mọi thứ đều đáng tin. Ngay cả chính bản thân anh. ','Mỹ',5,'Siêu Quậy nhí','Hoạt Hình',110,'https://www.youtube.com/embed/UdaZwNPQ9fk','đang chiếu',16,1,NULL,'3D 2D'),(2,'../assets/anhphim10.jpg','Đồng Đăng Giao','Khả Như, Kiều Minh Tuấn, Ngân Chi',1,'4/3/2020','Cuộc sống của một bà mẹ đơn thân cùng đứa con gái nhỏ thêm phần thú vị khi có sự xuất hiện của một người đàn ông lịch lãm, kế hoạch \"tìm chồng, tìm cha\" từ đây bắt đầu.','Việt Nam',5,'Nắng 3: Lời Hứa Của Cha','Hài, Tình cảm, Gia đình',109,'https://www.youtube.com/embed/DymKqNH_m8w','sắp chiếu',16,1,NULL,'3D 2D'),(3,'../assets/anhphim9.jpg','Dan Scanlon','Tom Holland, Chris Pratt',1,'6/3/2020','Lấy bối cảnh vùng ngoại ô một thế giới kỳ ảo, hai anh em yêu tinh tuổi teen bắt đầu hành trình khám phá xem, liệu rằng đâu đó ngoài kia có còn tồn tại ma thuật không?','Mỹ',5,'Onward - Truy Tìm Phép Thuật','Hoạt Hình',103,'https://www.youtube.com/embed/gn5QmllRCn4','sắp chiếu',16,1,NULL,'3D 2D'),(4,'../assets/anhphim12.jpg','Nikita Argunov','Milos Bikovic, Aleksey Serebryakov',1,'20/3/2020','Một kiến trúc sư trẻ tài năng tỉnh dậy sau một tai nạn kinh hoàng và phát hiện rằng anh ta đang lạc trong một thế giới khác kỳ lạ và hỗn loạn có tên COMA. Đây là không gian mà các định luật vật lý thông thường không tồn tại. Chàng kỹ sư ngoài việc thích nghi còn phải chiến đấu trước những thế lực bí ẩn để bảo vệ tính mạng và tìm cách trở lại thế giới thực. ','Nga',5,'Coma - Kẻ Đào Tẩu Giấc Mơ','Giả Tưởng',110,'https://www.youtube.com/embed/f4_18y4SNRg','đang chiếu',16,1,NULL,'3D 2D'),(5,'../assets/anhphim8.jpg','Jang Yoo Jeong','Ra Mi Ran, Kim Moo Yul, Na Moon Hee, Yoon Kyung Ho',1,'20/3/2020','Một nữ nghị sĩ có khả năng nói dối thiên tài đã đạt nhiều thành công trong sự nghiệp chính trị. Tuy nhiên ngay lúc kỳ tranh cử đang tới thì bà ta lại không thể nói dối được nữa. Khi sự thật phũ phàng đều bị phanh phui, liệu bà có đắc cử thành công hay không? ','Hàn Quốc',5,'Honest Candidate - Bà Hoàng Nói Dối','Hài',103,'https://www.youtube.com/embed/Ir47MpPUMHM','đang chiếu',16,1,NULL,'3D 2D'),(6,'../assets/anhphim11.jpg','Sandra Sciberras','Jolene Anderson,Stef Dawson',1,'20/3/2020','Một loài ký sinh trùng ngoài hành tinh tấn công người dân trên sa mạc và chiếm lấy não của họ. Tuy nhiên mối đe dọa thực sự đến nhân loại lại đến từ một sinh vật khác.','Úc',5,'The Dustwalker - Sa Mạc Chết','Ly kì, Giả Tưởng',89,'https://www.youtube.com/embed/TM6RldOunfE','sắp chiếu',16,1,NULL,'3D 2D'),(7,'../assets/anhphim2.png','Dan Scanlon','Gal Gadot, Pedro Pascal, Chris Pine',1,'5/6/2020','Phần tiếp theo của bộ phim siêu anh hùng Wonder Woman năm 2017.','Mỹ',5,'Wonder Woman 1984','Hành động, Phiêu lưu, Giả Tưởng',110,'https://www.youtube.com/embed/Vt168Du8Vyk','đang chiếu',16,1,NULL,'3D 2D'),(8,'../assets/anhphim7.jpg','Cate Shortland','Scarlett Johansson, Florence Pugh, Rachel Weisz',1,'1/5/2020','Phim là cuộc hành trình độc lập của một trong những chiến binh xuất sắc nhất hội Avengers - Black Widow, lần này đối thủ của cô là một ác nhân bí ẩn đầy mưu mô!','Mỹ',5,'Black Widow - Góa Phụ Đen','Hành động, Giả Tưởng, Phiêu lưu',110,'https://www.youtube.com/embed/ybji16u608U','sắp chiếu',16,1,NULL,'3D 2D'),(9,'../assets/anhphim4.jpg','Lý Hải','Ốc Thanh Vân, Huỳnh Đông, Mạc Văn Khoa, Võ Thành T',1,'30/4/2020','Một gia đình bị truy đuổi giữa vùng sông nước. Cơ hội nào cho người đàn ông cứu lấy vợ con khỏi bọn xã hội đen máu mặt?','Việt Nam',5,'Lật Mặt: 48H','Hành Động',103,'https://www.youtube.com/embed/-iCBapAoAsM','sắp chiếu',16,1,NULL,'3D 2D'),(10,'../assets/anhphim3.png','Điền Quân','Phương Anh Đào, Hiếu Nguyễn, Oanh Kiều',2,'17/4/2020','Liên tục mơ thấy bị một kẻ sát nhân không mặt mũi giết hàng đêm, cuộc sống của Phương Anh bị xáo trộn. Thế nhưng, điều kinh hoàng hơn còn xảy ra, khi tên Vô Diện Sát Nhân bước ra đời thực và truy sát cô. Hắn thực sự tồn tại hay chỉ là nỗi ám ảnh của Phương Anh?','Việt Nam',5,'Vô Diện Sát Nhân','Kinh Dị',89,'https://www.youtube.com/embed/8efH5QWJ334','sắp chiếu',16,1,NULL,'3D 2D'),(11,'../assets/anhphim6.jpg','Kyle Balda','Đang Cập Nhật',2,'3/7/2020','Minions - Những Quả Chuối Vàng biết đi sẽ trở lại trong câu chuyện chưa kể về tuổi thơ của Gru - cậu bé mười hai tuổi mơ được trở thành ác nhân xuất sắc nhất thế giới.','Mỹ',5,'Minions: The Rise of Gru','Hoạt Hình',110,'https://www.youtube.com/embed/54yAKyNkK7w','sắp chiếu',16,1,NULL,'3D 2D'),(12,'../assets/anhphim1.jpg','Dave Wilson','Vin Diesel, Eiza González',2,'11/3/2020','  Ray Garrison là một sĩ quan cấp cao đã hy sinh trong một trận chiến. Thế nhưng, anh được tái sinh bằng công nghệ cao, giúp Ray sở hữu sức mạnh siêu nhiên và khả năng phục hồi nhanh chóng. Vận dụng những kỹ năng mới, anh săn lùng gã đàn ông đã giết vợ mình. Thế nhưng, khi sự thật dần hé mở, Ray nhận ra rằng không phải mọi thứ đều đáng tin. Ngay cả chính bản thân anh. ','Mỹ',5,'Bloodshot','Hành Động',110,'https://www.youtube.com/embed/2xmqGklHWLI','đang chiếu',16,2,NULL,'3D 2D'),(13,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002651?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','HÙng Anh','Riku Hagiwara, Yusei Yagi',2,'2023-04-14','Hira, 17 tuổi, cố gắng ẩn mình ở trường, không bao giờ muốn phơi bày tật nói lắp của mình với các bạn cùng lớp. Anh ấy nhìn thế giới qua ống kính máy ảnh của mình, cho đến một ngày Kiyoi Sou bước qua cửa lớp...','Mỹ',5,'MY BEAUTIFUL MAN MOVIE: SPECIAL EDITION','Drama',132,'https://www.youtube.com/embed/vOUJrSHHp6g','đang chiếu',16,2,'2023-06-20','3D 2D'),(14,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002656?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Chris McKay','Nicolas  Cage, Nicholas Hoult',2,'2023-04-14','Renfield bị buộc phải bắt con mồi về cho chủ nhân và thực hiện mọi mệnh lệnh, kể cả những việc nhục nhã. Nhưng giờ đây, sau nhiều thế kỷ làm nô lệ, Renfield đã sẵn sàng để khám phá cuộc sống bên ngoài cái bóng của Hoàng Tử Bóng Đêm...','Mỹ',5,'RENFIELD','Horror',92,'https://www.youtube.com/watch?v=_hO0vGwqClM','đang chiếu',16,2,'2023-06-20','3D 2D'),(15,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002665?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Julius Avery','Russell Crowe, Daniel Zovatto',2,'2023-04-14','Từ những hồ sơ có thật của Cha Gabriele Amorth, Trưởng Trừ Tà của Vatican, \"The Popes Exorcist\" theo chân Amorth trong cuộc điều tra về vụ quỷ ám kinh hoàng của một cậu bé và dần khám phá ra những bí mật hàng thế kỉ mà Vatican đã cố giấu kín...','Mỹ',5,'THE POPES EXORCIST','Horror',104,'https://www.youtube.com/embed/33xtZdR0amI','đang chiếu',16,2,'2023-06-20','3D 2D'),(16,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002670?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Ben  Affleck','Viola Davis',2,'2023-04-14','Bí mật trong mối quan hệ hợp tác lịch sử giữa Nike và một vận động viên bóng rổ vĩ đại.Cả hai đã cho ra mắt thương hiệu Air Jordan đình đám và theo chân Sonny Vaccaro- saleman của Nike trong hành trình tiếp cận và đánh cược cả sự nghiệp vào Michael Jordan','Mỹ',5,'AIR','Drama',112,'https://www.youtube.com/embed/8BpGkBw76Zg','đang chiếu',16,2,'2023-06-20','3D 2D'),(17,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002663?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','MỸ TÂM','Ca sĩ Mỹ Tâm',2,'2023-04-08','Mỹ Tâm sẽ phác họa chân thực toàn bộ những diễn biến tâm lý và cảm xúc thăng trầm cùng những thăng hoa trong suốt quá trình thực hiện Liveshow \"Tri Âm\" lịch sử bằng những thước phim quý giá được quay lại trong 2 năm...','Mỹ',5,'NGƯỜI GIỮ THỜI GIAN : TRI ÂM ','Musical',106,'https://www.youtube.com/watch?v=8BdO_M8bUZo','đang chiếu',16,2,'2023-06-20','3D 2D'),(18,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002669?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Waew Waewwan Hongvivatana','Baipor Thitiya Jirapornsilp, Tony Anthony Buisseret',2,'2023-04-07','Hai chị em sinh đôi \"You\" và \"Me\"có ngoại hình và sở thích giống hệt nhau,thân thiết đến mức họ có thể chia sẻ mọi khía cạnh trong cuộc sống,cho đến khi một cậu bé - \"mối tình đầu\" của họ xuất hiện và đặt ra những thử thách khó khăn cho mối quan hệ của họ','Mỹ',5,'YOU & ME & ME ','Drama',121,'https://www.youtube.com/embed/rvy9TxYXNhc','đang chiếu',16,2,'2023-06-20','3D 2D'),(19,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002661?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Camille Delamarre','Henry Golding, Noomi Repace',2,'2023-04-07','Bảy tên sát thủ vô tình bị thiết lập trong một trò chơi sống còn. Morgan Gaines- một sát thủ chuyên nghiệp có nhiệm vụ phải giết bảy người,Morgan phát hiện ra bảy \"mục tiêu\" cũng là bảy sát thủ nặng ký. Lối thoát duy nhất cho Morgan là tìm ra kẻ chủ mưu..','Mỹ',5,'ASSASSIN CLUB','Action',109,'https://www.youtube.com/watch?v=usYcScx3yMk','đang chiếu',16,2,'2023-06-20','3D 2D'),(20,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002654?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Wei Hao Cheng','Greg Han Hsu, Gingle Wang',2,'2023-04-07','Ming-Han, một sĩ quan cảnh sát nhiệt huyết, trong quá trình truy bắt tội phạm đã tìm thấy một phong bì cưới màu đỏ và chủ nhân của nó là hồn ma Mao-Mao với nguyện vọng phải được kết hôn với một sĩ quan cảnh sát trước khi tái sinh...','Mỹ',5,'MARRY MY DEAD BODY ','Drama',130,'https://www.youtube.com/embed/4-C5mC0uSyE','đang chiếu',16,2,'2023-06-20','3D 2D'),(21,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002631?referenc