ợc cơ hội đổi đời khi biết tấm vé của cả nhóm trúng giải độc đắc 136.8 tỷ. Đột nhiên An,người giữ tấm vé bất ngờ qua đời, liệu trong hành trình tìm kiếm và chia chác món tiền trong mơ béo bở này sẽ đưa cả nhóm đến đâu?','Nhật Bản',5,'LẬT MẶT 6','Action',132,'https://www.youtube.com/watch?v=tpjjd7usfnA','sắp chiếu',16,3,'2023-06-20','3D'),(62,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002651?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','HÙng Anh','Riku Hagiwara, Yusei Yagi',1,'2023-04-14','Hira, 17 tuổi, cố gắng ẩn mình ở trường, không bao giờ muốn phơi bày tật nói lắp của mình với các bạn cùng lớp. Anh ấy nhìn thế giới qua ống kính máy ảnh của mình, cho đến một ngày Kiyoi Sou bước qua cửa lớp...','Nhật Bản',5,'MY BEAUTIFUL MAN MOVIE: SPECIAL EDITION','Drama',98,'https://www.youtube.com/embed/3MKRzG9k76Q','sắp chiếu',16,3,'2023-06-20','3D 2D'),(63,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002656?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Chris McKay','Nicolas  Cage, Nicholas Hoult',1,'2023-04-14','Renfield bị buộc phải bắt con mồi về cho chủ nhân và thực hiện mọi mệnh lệnh, kể cả những việc nhục nhã. Nhưng giờ đây, sau nhiều thế kỷ làm nô lệ, Renfield đã sẵn sàng để khám phá cuộc sống bên ngoài cái bóng của Hoàng Tử Bóng Đêm...','Nhật Bản',5,'RENFIELD','Horror',95,'https://www.youtube.com/watch?v=_hO0vGwqClM','sắp chiếu',16,3,'2023-06-20','3D 2D'),(64,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002666?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Alessandro Antonaci','Daniel Lascar',1,'2023-04-21','Trở về nhà sau mất mát của cha mẹ, Emma vô tình giải phóng những linh hồn quá khứ mắc kẹt trong chiếc radio cổ. Vô số câu chuyện bí ẩn lần lượt được vạch trần, liệu Emma sẽ tỉnh táo đối mặt hay cô sẽ bị nhấn chìm bởi quỹ dữ ?','Nhật Bản',5,'SOUND OF SILENCE','Horror',93,'https://www.youtube.com/embed/GAM3Pj__H-U','sắp chiếu',16,3,'2023-06-20','3D 2D'),(65,'../assets/IMG_5148.JPG','Andy  Muschietti','Ben  Affleck, Michael Shannon',NULL,'2023-06-16','Mùa hè này, đa thế giới sẽ va chạm khốc liệt với những bước chạy của FLASH','Nhật Bản',5,'THE FLASH ','Action',120,'https://www.youtube.com/watch?v=uXhf8LJq55Q','sắp chiếu',16,3,NULL,'3D 2D'),(66,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002674?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Lawrence Fowler','Michaela Longden, Rebecca Phillipson',1,'2023-04-14','Bí ẩn về cái chết của em gái Evie 20 năm trước, vào lúc 09:09 hằng đêm, hàng loạt cuộc chạm trán kinh hoàng xảy ra. Liệu Margot có biết được sự thật ai là kẻ giết em gái mình?\r\n','Việt Nam',5,'THE GHOST WITHIN','Horror',103,'https://www.youtube.com/watch?v=p_Ppe-2_Vh8','sắp chiếu',16,3,'2023-06-20','3D 2D'),(67,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002678?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Steven Caple Jr.','Michelle Yeoh, Dominique Fishback',1,'2023-06-09','Bộ phim dựa trên sự kiện Beast Wars trong loạt phim hoạt hình \"Transformers\", nơi mà các robot có khả năng biến thành động vật khổng lồ cùng chiến đấu chống lại một mối đe dọa tiềm tàng','Việt Nam',5,'TRANSFORMERS: RISE OF THE BEASTS','Action',112,'https://www.youtube.com/watch?v=gR2pkm9XVAY','sắp chiếu',16,3,'2023-06-20','3D 2D'),(68,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002665?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','Julius Avery','Russell Crowe, Daniel Zovatto',1,'2023-04-14','Từ những hồ sơ có thật của Cha Gabriele Amorth, Trưởng Trừ Tà của Vatican, \"The Popes Exorcist\" theo chân Amorth trong cuộc điều tra về vụ quỷ ám kinh hoàng của một cậu bé và dần khám phá ra những bí mật hàng thế kỉ mà Vatican đã cố giấu kín...','Việt Nam',5,'THE POPES EXORCIST','Horror',104,'https://www.youtube.com/embed/MagrY1rpOT4','sắp chiếu',16,2,'2023-06-20','3D 2D'),(69,'http://booking.bhdstar.vn/CDN/media/entity/get/FilmPosterGraphic/HO00002663?referenceScheme=HeadOffice&allowPlaceHolder=true&height=500','MỸ TÂM','Ca sĩ Mỹ Tâm',1,'2023-04-08','Mỹ Tâm sẽ phác họa chân thực toàn bộ những diễn biến tâm lý và cảm xúc thăng trầm cùng những thăng hoa trong suốt quá trình thực hiện Liveshow \"Tri Âm\" lịch sử bằng những thước phim quý giá được quay lại trong 2 năm...','Việt Nam',5,'NGƯỜI GIỮ THỜI GIAN : TRI ÂM ','Musical',106,'https://www.youtube.com/embed/8BdO_M8bUZo','sắp chiếu',16,2,'2023-06-20','3D 2D'),(70,'../assets/IMG_4973.JPG','21','21',NULL,'21','21','21',21,'21','21',21,'21','21',21,NULL,NULL,'21');
